INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118061, 8, 10118, 2, "青空の下で謁見", 0, 40, 7, 2834, "ペコリーヌとの出会い", 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118062, 8, 10118, 2, "未来の騎空団\nマスコット？", 0, 40, 7, 2835, "マホとの出会い", 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ランドソル市街地", 5118063, 8, 10118, 2, "お嬢さまからの\n緊急依頼", 0, 40, 7, 2837, "アキノとの出会い", 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118064, 8, 10118, 2, "黄金色の悩みごと", 0, 40, 18, 4108402, "ジュンとの出会い", 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118065, 8, 10118, 2, "白熱！　格闘大会！", 0, 40, 18, 4107402, "カオリとの出会い", 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("オーエド町", 5118066, 8, 10118, 2, "祭り太鼓はオーエドの華", 1, 40, 16, 9000227, "ニノンとの出会い", 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118067, 8, 10118, 3, "人気者は遅れて\nやってくる", 0, 40, 19, 2101181, "スズナとの出会い", 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ランドソル市街地", 5118068, 8, 10118, 3, "巫女・ミーツ・魔法少女", 0, 40, 18, 4109402, "ナナカとの出会い", 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118069, 8, 10118, 3, "ネズ耳は二度なくなる", 0, 40, 18, 4305402, "キャル＆コッコロとの出会い", 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ランドソル市街地", 5118070, 8, 10118, 3, "この出会いにカンパイ！", 0, 40, 18, 4101402, "ユカリとの出会い", 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("ランドソル市街地", 5118071, 8, 10118, 3, "陰陽アンサンブル", 0, 40, 18, 4106402, "アオイとの出会い", 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES ("フリーマーケット会場", 5118072, 8, 10118, 3, "運試し十番勝負！", 1, 40, 7, 2836, "シノブとの出会い", 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 0, 1);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (0, 5118600, 0, 10118, 1, "彼女たちの新たな日常", 0, 0, 0, 0, "オープニング", 0, 0, 10145115, 0);
